column6:
Atenção, Caeté!

Restam pouquíssimas vagas para os cursos técnicos ofertados pela Prefeitura em parceria com o @senacminas! São formações em Administração, Recursos Humanos e em Logística em cursos reconhecidos e de muita qualidade!

Os requisitos para se matricular são:

Técnico em Logística - 16 ANOS - Ter concluído ou estar cursando o Ensino Médio;
Técnico em Administração - 15 ANOS - Ter concluído ou estar cursando o Ensino Médio;
Técnico em Recursos Humanos - 16 ANOS - Ter concluído ou estar cursando o Ensino Médio.

Estamos aguardando você, no prédio Estação Cultura e Cidadania Monsenhor Domingos (CEU Bonsucesso), Av. Francisco de Paula Castro S/Nº, com a seguinte documentação:

✅Identidade com foto e CPF - frente e verso Ou Carteira de trabalho física;
✅Identidade com foto e CPF do responsável (caso seja menor de idade) - frente e verso;
✅Comprovante de residência atualizado (emitido em no máximo 3 meses) - frente e verso;
✅Comprovante de escolaridade (certificado, histórico escolar ou declaração escolar*) - frente e verso.
*declaração escolar tem a validade de 30 dias à partir da data de emissão, carimbo e MASP

#prefeituradecaete #trabalhoeresponsabilidade #caete #caetemg #cursostecnicos #senacminas #senac #educação

Chegou setembro e, como de praxe, nós reservamos este mês todos os anos para comemorar a melhor idade! Em 2022, vamos fazer um super evento para homenagear essas pessoas que têm uma história de vida que se confunde com a história de Caeté e que são muito importantes para todos nós!

Vamos festejar, durante os dias ,23, 24 e 25 de setembro, no Poliesportivo e traremos, ninguém mais, ninguém menos, que Erasmo Carlos, Sidney Magal e o queridinho dos idosos, Moacyr Franco!

Veja aí nossa programação e já marque na folhinha! Queremos ver todos felizes e celebrando a vida depois de 2 anos sem poder comemorar o mês mais importante do ano!

@erasmocarlosbr
@sidneymagaloficial
@moacyrfranco

#prefeituradecaete #trabalhoeresponsabilidade #caete #caetemg #festadamelhoridade #melhoridade #idoso #terceiraidade #moacyrfranco #sidneymagal #erasmocarlos

As inscrições para os cursos técnicos da parceria entre a Prefeitura e Senac estão abertas! São cursos de Logística, Administração e Recursos Humanos.

Estamos a postos, no CEU Bonsucesso, entre os dias 17 e 19 de agosto, das 9h às 17h, aguardando você.

Anote aí os documentos necessários para realizar a sua inscrição:

🟢RG frente e verso e CPF ou Carteira de Trabalho;

🟢RG frente e verso do responsável;

🟢Comprovante de residência atualizado emitido há, no máximo, 3 meses;

🟢 Comprovante de escolaridade (certificado, histórico ou declaração escolar com 30 dias de validade).

#prefeituradecaete #trabalhoeresponsabilidade #caete #caetemg #senacminas #senac #cursostecnicos @senacminas

